import React, {Component} from 'react';
import Markers from './Markers';

class ShelterAPI extends Component {
    render() {
        return (
            <Markers markers={this.state.markers} />
           
        )
    }

    state = {
        markers: []
    };

    componentDidMount() {
        fetch('http://localhost:5000/api/shelters')
            .then(res => res.json())
            .then((data) => {
                this.setState({ makers: data })
            })
            .catch(console.log)
            console.log()
    }
}

export default ShelterAPI;
